    return(
        <>
          <header>
              <div className="container-fluid">
                   <div className="row">
                      <div className="col-sm-2">
                         <img src={Logo}/>
                      </div>

                      <div className="col-sm-5">
                        <div className="headerSearch d-flex align-items-center">

                        </div>
                      </div>
                      {/*headerSearch start here*/}
                   </div>
              </div>
          </header>
        </>
    )
}
export default Headers;
